Cuántas ganas tenía de conocerte!!! Y ya estamos aquí, demasiado felices y con sentimientos encontrados 🥹 Por un lado desbordada de ilusión por lo que nos espera este domingo en #Berlin42K y por el otro con toooodo el cansancio encima por el viaje, adaptándome al cambio de horario, los nervios y esos “dolorcitos inesperados” que aparecen justo unos días antes de correr una maratón. Dicen que todo está en la mente así es que solo queda confiar y disfrutar ✨ Con fe para este domingo poder cruzar la puerta de Brandeburgo con la misma sonrisa que en este video 💪

@berlinmarathon #AnnaCarinaBerlin #brandeburgo #berlinlegend #runforjoy

#Berlin42K Se logró!!!!! 🥹🏅🇩🇪

No puedo sentirme más emocionada y agradecida. Nadie dijo que fuera fácil, haber corrido una maratón no solo involucran las piernas, si no también la mente y el corazón. 

Pero nada de esto hubiera sido posible sin mi mejor partner de todos, @paulbebin 🫶 Para empezar, quien me animó a participar de una maratón y el que ha vivido de cerca toditos mis nervios e inseguridades. Gracias por la paciencia, los mejores consejos, todo tu amor y el compromiso en todos estos meses de esfuerzo y preparación 🙏 Correr mis primeros 42Km junto a más de 50,000 personas de 150 países ha sido una de las experiencias más increíbles de mi vida y eso te lo debo a ti 🥹🫶

Quiero agradecer a todo el equipo que me ha acompañado en el proceso y ha sido clave para cumplir este reto personal en 4hr06min! 🤩
